@Override
protected final boolean lessThan(FieldsEnumWithSlice fieldsA, FieldsEnumWithSlice fieldsB) {
  // No need to break ties by field name: TermsEnum handles that
  return fieldsA.current.compareTo(fieldsB.current) < 0;
}

